import React, { useState, useEffect } from "react";
import { Link, useParams } from "react-router-dom";

import VideoModal from "../components/VideoModal";
import Loading from "../components/Loading";

export default function Team(){
    const { id } = useParams();

    const [data, setData] = useState([]);
    const [parsedData, setParsedData] = useState(null);
    const [loading, setLoading] = useState(true);

    const fetchData = async ( id ) => {
        try {
          const response = await fetch(`http://localhost:8000/api/retrieve-a-page-teams?id=${id}`, {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
            },
          });

          if (!response.ok) {
            throw new Error("Network response was not ok");
          }

          const result = await response.json();

          setData(result.properties);
        } catch (error) {
          console.error("Error fetching data:", error.message);
        }
      };


    useEffect(() => {
    fetchData(id);
    }, []);

    useEffect( () => {
      if(data){
        console.log(data);
      }
        setLoading(false);
    }, [data]);

    return (
      <div className = "page">

        { data && data.Name?.title?.[0]?.plain_text }

        <h2>Players :</h2>
        { data &&
          data.Players?.relation.map( ( item, index ) => {
            const rollupItem = data.Rollup?.rollup.array[index];

            return (
              <div key = { index }>
                { rollupItem?.title?.[0]?.plain_text && item?.id && (
                  <Link to = {`/player/${item.id}`} >
                    <div>{ rollupItem.title[0].plain_text }</div>
                  </Link>
                )}

              </div>
            );
          })}
      </div>
    );
}
